import React, { useEffect, useState } from "react";
import { useRouter } from "next/router";
import { base } from "../../utils/airtableUtils";

export default function UserTeam() {
  const [team, setTeam] = useState([]);
  const {
    query: { userId },
  } = useRouter();

  useEffect(() => {
    if (userId) {
      base("Draft Selections")
        .select({
          view: "Grid view",
        })
        .eachPage(
          function page(records) {
            records.forEach(function ({ fields }) {
              if (fields.userId === userId) {
                console.log("fields", fields);
                setTeam(fields.players);
              }
            });
          },
          function done(err) {
            if (err) {
              console.error(err);
              return;
            }
          }
        );
    }
  }, [userId]);
  return (
    <div>
      <h1>User Team</h1>
      {team && <div>{team[0]}</div>}
    </div>
  );
}
